const categorylist = [
  { image: "./logo192.png", title: "cabbage" },
  { image: "./logo192.png", title: "Galic" },
  { image: "./logo192.png", title: "Apple" },
];
function CategoryBar() {
  const Category = categorylist.map((category) => (
    <div className="grid place-items-center mx-14 my-2">
      <img src={category.image} width={50} />
      <h1>{category.title}</h1>
    </div>
  ));

  return <div className="flex w-full bg-grey justify-center">{Category}</div>;
}

export default CategoryBar;
